                var abcd = Math.Round(Convert.ToDecimal(abc), 0);
                //HurdleSpecificScoreF.Text = Convert.ToString(abcd) + " F3";
                HurdleSpecificScoreF.Text = Convert.ToString(abcd);

                //HurdleSpecificScoreF.Text = Convert.ToString(fltHurdleSpecificScoreF) + " F3";
            }
            else
                HurdleSpecificScoreF.Text = "Unable to Determine";//In Case No Score is Set

            #endregion[current values for left]
        }
        //  WriteObjectsToPageAjax();
    }

