    public class ErrorList
    {

        public MessageType messageType { get; set; }
        public static string errorMsg { get; set; }
        //public static string _resultMsg = string.Empty;
        //public static string _specialMsg = string.Empty;
        public static ArrayList _resultMsg = new ArrayList();
        public static ArrayList _specialMsg = new ArrayList();
        public static ArrayList _generalMsgs = new ArrayList();
        public static ArrayList _airMsgs = new ArrayList();
        public static ArrayList _specific = new ArrayList();
        public static ArrayList _specific_Air = new ArrayList();

        public enum MessageType
        {
            RESULT = 0,
            SPECIAL,
            GENERAL,
            Air,
            Specific,
            Specific_Air
        }

        public ErrorList() { }
        public void StoreErrMsg(MessageType messageType, string errorMsg)
        {
            //if (messageType == MessageType.RESULT) _resultMsg = errorMsg;
            //else if (messageType == MessageType.SPECIAL) _specialMsg = errorMsg;
            if (messageType == MessageType.RESULT) _resultMsg.Add(errorMsg);
            else if (messageType == MessageType.SPECIAL) _specialMsg.Add(errorMsg);

            else if (messageType == MessageType.GENERAL) _generalMsgs.Add(errorMsg);
            else if (messageType == MessageType.Air) _airMsgs.Add(errorMsg);
            else if (messageType == MessageType.Specific) _specific.Add(errorMsg);
            else _specific_Air.Add(errorMsg);
        }
    }


    string returnErrorMessageForStart(int step)
    {
        ErrorList errorList = new ErrorList();
        string errorMessages = string.Empty;
       // ErrorList._specialMsg = "";
        if (!isComparison)
        {
            if (DropDownList1.SelectedItem.Text.EndsWith("Model View  Initial") || DropDownList1.SelectedItem.Text.EndsWith("Video View  Initial"))
            {
                if (step == 1)
                {
                    #region[Front Block Distance]
                    if (lblSetFrontBlockDistanceM1.ForeColor == Color.Red)
                    {
                        if (Math.Abs(Convert.ToSingle(lblSetFrontBlockDistanceI.Text)) < Convert.ToSingle(lblSetFrontBlockDistanceM1.Text))
