    //sprint error messages
    string returnErrorMessage(int step)
    {
        ErrorList errorList = new ErrorList();
        //ErrorList._specialMsg = "";
        //ErrorList._resultMsg = "";
        string errorMessages = string.Empty;
        isComparisons = isComparison;
        if (!isComparison)
        {
            if (DropDownList1.SelectedItem.Text.EndsWith("Model View  Initial") || DropDownList1.SelectedItem.Text.EndsWith("Video View  Initial"))
            {
                #region[velocity]
                //if (step == 1 || step == 2 || step == 3 || step == 4 || step == 5 || step == 6 || step == 7)
                if (step == 2 || step == 4 || step == 6)
                {
                    if (lblVelocityM1.ForeColor == Color.Red)
                    {
                        errorMessages += "Result: Sprint Velocity is Too Low (Compared to World Record Performance)#!#";
                        errorList.StoreErrMsg(ErrorList.MessageType.RESULT, "Sprint Velocity is Too Low (Compared to World Record Performance)");
                    }
                }

                #endregion[Velocity]
                #region[Ground Time]
                if (step == 2 || step == 4 || step == 6)
                {
                    if (lblGroundTimeLeftM1.ForeColor == Color.Red)
                    {
                        if (lblGroundTimeRightM1.ForeColor == Color.Red)
                        {
                            errorMessages += "General: Ground Time is Too Long#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Ground Time is Too Long");
                        }
                        else
                        {
                            errorMessages += "General: Ground Time Left is Too Long#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Ground Time Left is Too Long");
                        }
                    }
                    else
                        if (lblGroundTimeRightM1.ForeColor == Color.Red)
                        {
                            errorMessages += "General: Ground Time Right is Too Long#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Ground Time Right is Too Long");
                        }
                }
                #endregion[Ground Time]
                #region[air time]
                if (step == 3 || step == 5 || step == 7)
                {
                    if (lblAirTimeLeftToRightM1.ForeColor == Color.Red)
                    {
                        if (Convert.ToDouble(lblAirTimeLeftToRightI.Text) < Convert.ToDouble(lblAirTimeLeftToRightM1.Text))
                        {
                            if (lblAirTimeRightToLeftM1.ForeColor == Color.Red)
                            {
                                if (Convert.ToDouble(lblAirTimeRightToLeftI.Text) < Convert.ToDouble(lblAirTimeRightToLeftM1.Text))
                                {
                                    errorMessages += "General: Air Time is Too Short#!#";
                                    sprintAirTimeLtoRandRtoLShortI = true;

                                    sprintAirTimeAverageI = true;
                                    errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time is Too Short");
                                }
                                else
                                {
                                    errorMessages += "General: Air Time Left to Right is Too Short#!#";
                                    errorMessages += "General: Air Time Right to Left is Too Long#!#";
                                    errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Left to Right is Too Short");
                                    errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Right to Left is Too Long");
                                }
                            }
                            else
                            {
                                errorMessages += "General: Air Time Left to Right is Too Short#!#";
                                sprintAirTimeLtoRShortI = true;
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Left to Right is Too Short");
                            }
                        }
                        else if (lblAirTimeRightToLeftM1.ForeColor == Color.Red)
                        {
                            if (Convert.ToDouble(lblAirTimeRightToLeftI.Text) > Convert.ToDouble(lblAirTimeRightToLeftM1.Text))
                            {
                                errorMessages += "General: Air Time is Too Long#!#";
                                sprintAirTimeRtoLLongI = true;
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time is Too Long");
                            }
                            else
                            {
                                errorMessages += "General: Air Time Left to Right is Too Long#!#";
                                errorMessages += "General: Air Time Right to Left is Too Short#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Left to Right is Too Long");
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Right to Left is Too Short");
                            }
                        }
                        else
                        {
                            errorMessages += "General: Air Time Left to Right is Too Long#!#";
                            sprintAirTimeLtoRLongI = true;
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Left to Right is Too Long");
                        }
                    }
                    else if (lblAirTimeRightToLeftM1.ForeColor == Color.Red)
                    {
                        if (Convert.ToDouble(lblAirTimeRightToLeftI.Text) < Convert.ToDouble(lblAirTimeRightToLeftM1.Text))
                        {
                            errorMessages += "General: Air Time Right to Left is Too Short#!#";
                            sprintAirTimeRtoLShortI = true;
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Right to Left is Too Short");
                            errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Air Time Right to Left is Too Short");
                        }
                        else
                        {
                            errorMessages += "General: Air Time Right to Left is Too Long#!#";
                            sprintAirTimeRtoLLongI = true;
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Air Time Right to Left is Too Long");
                            errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Air Time Right to Left is Too Long");
                        }
                    }
                }
                #endregion[air time]
                #region[Stride Rate]
                if (lblStrideRateM1.ForeColor == Color.Red)
                {
                    if (step == 2 || step == 4 || step == 6)
                    {
                        if (lblGroundTimeLeftM1.ForeColor == Color.Red || lblGroundTimeRightM1.ForeColor == Color.Red)
                        {
                            if (Convert.ToDouble(lblStrideRateI.Text) < Convert.ToDouble(lblStrideRateM1.Text))
                            {
                                errorMessages += "General: Stride Rate is Too Low#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Stride Rate is Too High");
                            }
                        }
                    }
                    else
                    {
                        if (Convert.ToDouble(lblStrideRateI.Text) < Convert.ToDouble(lblStrideRateM1.Text))
                        {
                            if (sprintAirTimeLtoRandRtoLLongI == true || sprintAirTimeRtoLLongI == true || sprintAirTimeLtoRLongI == true)
                            {
                                errorMessages += "General: Stride Rate is Too Low#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Rate is Too Low");
                            }
                        }
                        else
                        {
                            if (sprintAirTimeLtoRandRtoLShortI == true || sprintAirTimeRtoLShortI == true || sprintAirTimeLtoRShortI == true)
                            {
                                errorMessages += "General: Stride Rate is Too High#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Rate is Too High");
                            }
                        }
                    }
                }
                #endregion[Stride Rate]
                #region[Time To Upper Leg Full Flexion]
                if (step == 2 || step == 4 || step == 6)
                {
                    if (lblTimeToUpperLegFullFlexionLeftM1.ForeColor == Color.Red)
                    {
                        if (lblTimeToUpperLegFullFlexionRightM1.ForeColor == Color.Red)
                        {
                            errorMessages += "General: Time To Upper Leg Full Flexion (High Knee Position) During Air Phase is Too Short#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Time To Upper Leg Full Flexion (High Knee Position) During Air Phase is Too Short");
                        }
                        else
                        {
                            errorMessages += "General: Time To Upper Leg Full Flexion Left (High Knee Position) During Air Phase is Too Short#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Time To Upper Leg Full Flexion Left (High Knee Position) During Air Phase is Too Short");
                        }
                    }
                    else
                        if (lblTimeToUpperLegFullFlexionRightM1.ForeColor == Color.Red)
                        {
                            errorMessages += "General: Time To Upper Leg Full Flexion Right (High Knee Position) During Air Phase is Too Short#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Time To Upper Leg Full Flexion Right (High Knee Position) During Air Phase is Too Short");
                        }
                }
                #endregion[Time To Upper Leg Full Flexion]
                #region[stride length]
                if (step == 3 || step == 5 || step == 7)
                {
                    if (sprintStrideLengthAverageI)
                    {
                        if (sprintStrideLengthRtoLShortI)
                        {
                            errorMessages += "Special: Not Producing Sufficient Stride Length During Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, " Not Producing Sufficient Stride Length During Ground Contact");
                        }
                        else
                        {
                            errorMessages += "Special: Too Much Time Producing Excessive Stride Length During Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, " Too Much Time Producing Excessive Stride Length During Ground Contact");
                        }
                    }
                    else
                    {
                        if (sprintStrideLengthRtoLShortI)
                        {
                            errorMessages += "Special: Not Producing Sufficient Stride Length During Right Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, " Not Producing Sufficient Stride Length During Right Ground Contact");
                        }
                        else if (sprintStrideLengthRtoLLongI)
                        {
                            errorMessages += "Special: Too Much Time Producing Excessive Stride Length During Right Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, " Too Much Time Producing Excessive Stride Length During Right Ground Contact");
                        }
                        if (sprintStrideLengthLtoRShortI)
                        {
                            errorMessages += "Special: Not Producing Sufficient Stride Length During Left Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, " Not Producing Sufficient Stride Length During Left Ground Contact");
                        }
                        else if (sprintStrideLengthLtoRLongI)
                        {
                            errorMessages += "Special: Too Much Time Producing Excessive Stride Length During Left Ground Contact#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.SPECIAL, "Too Much Time Producing Excessive Stride Length During Left Ground Contact");
                        }
                    }
                }
                #endregion[stride length]
                #region[Trunk Angle at Touchdown]

                //Mann Changes Begin

                if (step == 1 || step == 3 || step == 5 || step == 7)
                {
                    if (lblTrunkAngleAtTouchdownLeftM1.ForeColor == Color.Red)
                    {
                        if (lblTrunkAngleAtTouchdownRightM1.ForeColor == Color.Red)
                        {
                            if (Convert.ToInt16(lblTrunkAngleAtTouchdownRightI.Text) < Convert.ToInt16(lblTrunkAngleAtTouchdownRightM1.Text))
                            {
                                if (Convert.ToInt16(lblTrunkAngleAtTouchdownLeftI.Text) < Convert.ToInt16(lblTrunkAngleAtTouchdownLeftM1.Text))
                                {
                                    errorMessages += "Specific: Trunk Angle at Touchdown is Too Flexed#!#";
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown is Too Flexed");
                                }
                                else
                                {
                                    errorMessages += "Specific: Trunk Angle at Touchdown Right is Too Flexed#!#";
                                    errorMessages += "Specific: Trunk Angle at Touchdown Left is Too Upright#!#";
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Right is Too Flexed");
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Left is Too Upright");
                                }
                            }
                            else
                            {
                                if (Convert.ToInt16(lblTrunkAngleAtTouchdownLeftI.Text) > Convert.ToInt16(lblTrunkAngleAtTouchdownLeftM1.Text))
                                {
                                    errorMessages += "Specific: Trunk Angle at Touchdown is Too Upright#!#";
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown is Too Upright");
                                }
                                else
                                {
                                    errorMessages += "Specific: Trunk Angle at Touchdown Right is Too Upright 1#!#";
                                    errorMessages += "Specific: Trunk Angle at Touchdown Left is Too Flexed 1#!#";
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Right is Too Upright");
                                    errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Left is Too Flexed");
                                }
                            }
                        }
                        else
                        {
                            if (Convert.ToInt16(lblTrunkAngleAtTouchdownLeftI.Text) < Convert.ToInt16(lblTrunkAngleAtTouchdownLeftM1.Text))
                            {
                                errorMessages += "Specific: Trunk Angle at Touchdown Left is Too Flexed#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Left is Too Flexed");
                            }
                            else
                            {
                                errorMessages += "Specific: Trunk Angle at Touchdown Left is Too Upright#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Left is Too Upright");
                            }
                        }
                    }
                    else
                    {
                        if (lblTrunkAngleAtTouchdownRightM1.ForeColor == Color.Red)
                        {
                            if (Convert.ToInt16(lblTrunkAngleAtTouchdownRightI.Text) < Convert.ToInt16(lblTrunkAngleAtTouchdownRightM1.Text))
                            {
                                errorMessages += "Specific: Trunk Angle at Touchdown Right is Too Flexed#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Right is Too Flexed");
                            }
                            else
                            {
                                errorMessages += "Specific: Trunk Angle at Touchdown Right is Too Upright#!#";
                                errorList.StoreErrMsg(ErrorList.MessageType.Specific_Air, "Trunk Angle at Touchdown Right is Too Upright");
                            }
