    //For HurdleSteps ReturnError Messages
    string returnErrorMessageHurdleSteps(int step)//for HurdleSteps
    {
        ErrorList errorList = new ErrorList();
        string errorMessages = string.Empty;
      //  ErrorList._specialMsg = "";
        if (!isComparison)
        {
            if (DropDownList1.SelectedItem.Text.EndsWith("Model View  Initial") || DropDownList1.SelectedItem.Text.EndsWith("Video View  Initial"))
            {
                #region[Velocity]
                if (step == 2 || step == 4 || step == 6)
                {
                    if (lblHurdleStepVelocityM1.ForeColor == Color.Red)
                    {
                        errorMessages += "Result: Hurdle Step Velocity is Too Low (Compared to World Record Performance)#!#";
                        errorList.StoreErrMsg(ErrorList.MessageType.RESULT, "Hurdle Step Velocity is Too Low (Compared to World Record Performance)");

                    }
                }
                #endregion[Velocity]
                #region[Stride Length Into]
                if (step == 7)
                {
                    if (lblHurdleStepIntoM1.ForeColor == Color.Red) //lblHurdleStepIntoI
                    {
                        if (Math.Abs(Convert.ToSingle(lblHurdleStepIntoI.Text)) < Convert.ToSingle(lblHurdleStepIntoM1.Text))
                        {
                            errorMessages += "General: Stride Length Into the Hurdle is Too Short#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Length Into the Hurdle is Too Short");
                        }
                        else
                        {
                            errorMessages += "General: Stride Length Into the Hurdle is Too Long#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Length Into the Hurdle is Too Long");
                        }
                    }
                }
                #endregion[Stride Length Into]
                #region[Stride Length Off]
                if (step == 1)
                {
                    if (lblHurdleStepOffM1.ForeColor == Color.Red)//lblHurdleStepOffM1
                    {
                        if (Math.Abs(Convert.ToSingle(lblHurdleStepOffI.Text)) < Convert.ToSingle(lblHurdleStepOffM1.Text))
                        {
                            errorMessages += "General: Stride Length Off the Hurdle is Too Short#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Length Off the Hurdle is Too Short");
                        }
                        else
                        {
                            errorMessages += "General: Stride Length Off the Hurdle is Too Long#!#";
                            errorList.StoreErrMsg(ErrorList.MessageType.Air, "Stride Length Off the Hurdle is Too Long");
                        }
                    }
                }
                #endregion[Stride Length Off]
                #region[Ground Time]
                if (step == 2)
                {
                    if (lblStep1HSGroundTimeM1.ForeColor == Color.Red)
                    {
                        errorMessages += "General: Ground Time Off the Hurdle (Step 1) is Too Long#!#";
                        errorList.StoreErrMsg(ErrorList.MessageType.GENERAL, "Ground Time Off the Hurdle (Step 1) is Too Long");
                    }
