                        System.Web.UI.WebControls.ListItem item = new System.Web.UI.WebControls.ListItem(date + "-" + location + "-" + "Model View  Initial", m.MovieId.ToString(), true);
                        firstMovie = Convert.ToInt32(item.Value);
