    void sendPDF_FileEmail(string ErrorPDf)
    {
        var email = Membership.GetUser().Email;
        System.Net.Mail.MailMessage msg = new System.Net.Mail.MailMessage();
        msg.From = new System.Net.Mail.MailAddress("dev@compusport.com");
        msg.To.Add(email);

        msg.Attachments.Add(new Attachment(ErrorPDf));
        //msg.Body = message;
        msg.Subject = Path.GetFileName(ErrorPDf);
        System.Net.Mail.SmtpClient smtp = new System.Net.Mail.SmtpClient();
        smtp.Host = "198.143.141.120";
        smtp.Port = 25;
        smtp.Credentials = new System.Net.NetworkCredential("dev@compusport.com", "develop!?");
        smtp.Send(msg);

    }

